import React, {PureComponent} from 'react';
import {NavLink} from 'react-router-dom';
import headerStyle from './index.module.css';
import loginIcon from '../../images/loginIcon.png';
import {Route, Switch} from "react-router";
import Empty from "../../images/Empty";

class Header extends PureComponent {
    render() {
        return (
            <>
                <div className={headerStyle.header}>
                    <div className={headerStyle.left}>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/index'>首页</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/production'>产品中心</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/community'>飞云社区</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/join'>加入飞云</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/wiki'>开发wiki</NavLink>
                    </div>
                    <div className={headerStyle.right}>
                        <img src={loginIcon}/>
                        <a href='#'>企业注册</a>
                    </div>
                </div>
                <div>
                    <Switch>
                        <Route path='/index' component={Empty}/>
                        <Route path='/production' component={Empty}/>
                        <Route path='/community' component={Empty}/>
                        <Route path='/join' component={Empty}/>
                        <Route path='/wiki' component={Empty}/>
                    </Switch>
                </div>
            </>

        );
    }
}

export default Header;
